import Card from "../Card/Card";
import styles from "./Cards.module.css";

export default function Cards({ characters, onClose }) {
  return (
    <div className={styles.contenedor}>
      <p>RICK AND MORTY</p>
      {characters.map(({ id, name, species, gender, image }) => {
        return (
          <div>
            <Card
              key={id}
              id={id}
              name={name}
              species={species}
              gender={gender}
              image={image}
              onClose={onClose}
            />
          </div>
        );
      })}
    </div>
  );
}
